import { UIStateType } from './UIStateType';
export class UserInfoState {
    stateType;
    userInfo;
    errorDialogState;
    constructor(stateType, userInfo, errorDialogState) {
        this.stateType = stateType;
        this.userInfo = userInfo;
        this.errorDialogState = errorDialogState;
    }
    static loading() {
        return new UserInfoState(UIStateType.LOADING, undefined, undefined);
    }
    static userInfo(userInfo) {
        return new UserInfoState(UIStateType.READY, userInfo, undefined);
    }
    static error(errorDialogState) {
        return new UserInfoState(UIStateType.ERROR, undefined, errorDialogState);
    }
}
